import React from "react";
import { useSelector, useDispatch } from "react-redux";

function Result() {
  const { PersonalInformation } = useSelector((state) => state.resumeReducer);
  const dispatch = useDispatch();

  return (
    <div>
      <ul>
        <li>{PersonalInformation.name}</li>
        <li>{PersonalInformation.phone}</li>
        <li>{PersonalInformation.email}</li>
      </ul>
    </div>
  );
}

export default Result;
